import React, { Component } from 'react';
import { Button, Card, Elevation, Tab, Tabs } from '@blueprintjs/core';

import AppBar from '../../components/AppBar/AppBar';
import MainContainer from '../../components/MainContainer/MainContainer';
import Sidebar from '../../components/Sidebar/Sidebar';
import QuickView from '../../components/QuickView/QuickView';
import CardHeader from '../../components/Card/CardHeader';
import CardBody from '../../components/Card/CardBody';

import TestView1 from './components/TestComponent1';
import TestView2 from './components/TestComponent2';
import TestView3 from './components/TestComponent3';
import TestView4 from './components/TestComponent4';

export default class BluePrintView extends Component {
   render() {
      return (
         <div>
            <AppBar></AppBar>
            <Sidebar />
            <MainContainer>
               <QuickView />
               <Card elevation={Elevation.THREE} className='m-3'>
                  <CardHeader>Analytical applications</CardHeader>
                  <CardBody>
                     <div className='bp3-card-body'>
                        <p>
                           User interfaces that enable people to interact
                           smoothly with data, ask better questions, and make
                           better decisions.
                        </p>
                        <Button icon='document'>Upload...</Button>
                     </div>
                  </CardBody>
               </Card>
               <Tabs
                  id='TabsExample'
                  onChange={this.handleTabChange}
                  selectedTabId='rx'
               >
                  <Tab id='ng' title='Angular' panel={<TestView1 />} />
                  <Tab
                     id='mb'
                     title='Ember'
                     panel={<TestView2 />}
                     panelClassName='ember-panel'
                  />
                  <Tab id='rx' title='React' panel={<TestView3 />} />
                  <Tab
                     id='bb'
                     disabled
                     title='Backbone'
                     panel={<TestView4 />}
                  />

                  <input
                     className='bp3-input'
                     type='text'
                     placeholder='Search...'
                  />
               </Tabs>
            </MainContainer>
         </div>
      );
   }
}
